tree标签
tree标签的属性 :

tree标签属性分别如下：
其中id、tree_id、sql_key为必填项

* id ： id属性
name ： name属性
size ： size为尺寸标签,可以填的数值范围为（1-12）,如size="6",默认size为5
checkbox_have ： 为是否有复选框，默认false
* tree_id ： tree树对象的id
* sql_key ： sql_key属性为select标签后台执行的sql的key值
sql_condition : sql_condition属性用于配合sql_key属性，当对应的后台sql需要传入参数替换“？”占位符时填写，也可以用登录用户的id替换占位符如sql_condition="ACC_RECHG_TYPE,session.operId",其中‘ACC_RECHG_TYPE’会用来替换第一个占位符，登录用户的id会用来替换第二个占位符；
注意：【1.4】版本后分隔符由“，”替换成为“&&&”
edit_flag【1.9】： tree树的可编辑开关，默认false，开启时节点支持编辑功能，包括（新增节点，修改节点，删除节点，移动节点等编辑功能）
nav_flag【1.9】： tree的支持用于含有导航页功能开发的开关，默认false，edit_flagb必须为true时开启有效，开启时节点支持编辑功能且需要绑定加载页面的url，节点编辑功能包括（新增节点，修改节点，删除节点，移动节点等编辑功能）
cust_get_data_clazz【1.9】： 该功能用于支持自定义加载tree的初始化数据，如果该项存在，则将屏蔽sql_key的加载数据功能，指定加载类和方法,规则示例将在下面展示；
cust_get_data_param【1.9】： 该功能用于支持自定义加载tree的初始化数据，如果该项存在，则将屏蔽sql_key的加载数据功能，指定加载类和方法的参数（现阶段只支持单个参数且为Map类型）,规则示例将在下面展示；
url【1.9.1】： 由于1.9版本的tree编辑功能存在异步加载问题，所以【1.9.1】作为【1.9】版本的修复版，注意，当edit_flag功能开启时，必须要配合url属性来加载数据，其他两种方式将不支持
expand_tree【2.4】： 该属性为控制初始化是否展开树节点，默认true


tree标签的引入方式 :

对应sql语句 :

SELECT
sf.FUNC_ID AS id,
sf.PARENT_ID AS pId,
sf.TITLE AS name,
(
CASE
WHEN sf.FUNC_ID IN (
SELECT
srf.FUNC_ID
FROM
sys_role_func srf,
sys_role sr,
sys_oper_role sor
WHERE
srf.ROLE_ID = sr.ROLE_ID
AND
sor.ROLE_ID = sr.ROLE_ID
AND
sor.OPER_ID = ?
) THEN
'true'
ELSE
'false'
END
) AS checked
FROM
sys_func sf
上图中红色别名必须有，且区分大小，分别对应 : 树节点的id，父级id，和显示的text名
