小技巧【Tips】


新增页和编辑页使用技巧


新增页@modal_body：与列表页在同一页面，该页面数据的列表页加载时就同步加载完成，用于不需要实时显交互显示示数据的场景，如新增。

编辑页@modal_iframe：新打开iframe页面，该页面的数据是临时请求后台做些处理，再实时加载，包括页面的表单控件数据，如编辑、详情等。
！！！！但若由于特殊需要，在新增页也希望能动态实时的加载数据，那么也可以使用@modal_iframe来代替@modal_body

sqlmapper.xml的列表查询和记录条数查询技巧


！！！！通常查询列表页的分页查询，需要写2个sql，一个查询明细，一个查询总数，但当业务及关联表、关联条件非常复杂时，需要重复代码，且若业务条件有调整，就需要两个查询语句一起修改，且容易忘记或漏掉，因此可以将两个的公共条件部分提取成【sql片段】，片段内容自己组合把握，相当于include的作用


